def add_style(node, name, value):
    node.set("style", node.get("style", "") + name + ": " + value + "; ")

def create_document():
    root = ET.Element("html")
    tree = ET.ElementTree(root)

    headNode = ET.SubElement(root, "head")
    ET.SubElement(headNode, "meta", {"http-equiv": "content-type",
                                     "content": "text/html; charset=UTF-8"})

    ET.SubElement(headNode, "meta", {"name": "viewport",
                                     "content": "width=device-width, initial-scale=1"})

    ET.SubElement(headNode, "link", {"rel": "icon",
                                     "href": favicon})

    titleNode = ET.SubElement(headNode, "title")
    titleNode.text = "Project-GC Addon Progress"

    styleNode = ET.SubElement(headNode, "style")
    styleNode.text = GLOBAL_STYLE

    bodyNode = ET.SubElement(root, "body")
    add_style(bodyNode, "background-color", "lightgoldenrodyellow")

    h1Node = ET.SubElement(bodyNode, "h1")
    add_style(h1Node, "text-align", "center")
    h1Node.text = "Project-GC Addon Progress"    

    return tree, bodyNode

def error_details(errors):
    deatilsNode = ET.Element("details")

    summaryNode = ET.SubElement(detailsNode, "summary")
    spanNode = ET.SubElement(summaryNode, "span")
    add_style(spanNode, "color", COLOR_RED)
    spanNode.text = "Errors"


    pNode = ET.SubElement(detailsNode, "p")
    pNode.text = "You can help improve this tool by sending an "
    aNode = ET.SubElement(pNode, "a", {"href", "mailto:entropyendeavor@gmail.com"})
    aNode.text = "email"
    aNode.tail = ' with the following errors and/or your "My Finds" GPX file.'

    ulNode = ET.SubElement(detailsNode, "ul")

    for error in errors:
        liNode = ET.SubElement(ulNode, "li")
        spanNode = ET.SubElement(liNode, "span")
        add_style(spanNode, "color", COLOR_RED)
        spanNode.text = error

    return detailsNode

def badge_section(bodyNode, badgeName, country=False):
    sectionName = badgeName.lower().replace(" ", "_")
    
    ET.SubElement(bodyNode, "hr")

    sectionNode = ET.SubElement(bodyNode, "section", {"id": sectionName})

    detailsNode = ET.SubElement(sectionNode, "details")
    
    summaryNode = ET.SubElement(detailsNode, "summary")
    add_style(summaryNode, "font-size", "1.5em")
    bNode = ET.SubElement(summaryNode, "b")
    bNode.text = badgeName
    bNode.tail = (" Country" if country else "") + " Badge"
    
    return detailsNode

def see_combined():
    pNode = ET.Element("p")
    pNode.text = 'Please see "Combined Calendars" section for '

    bNode = ET.SubElement(pNode, "b")
    bNode.text = "366"
    bNode.tail = " addon progress."

    return pNode

def x_mark(size=None):
    spanNode = ET.Element("span")
    add_style(spanNode, "color", COLOR_RED)
    if size is not None:
        add_style(spanNode, "font-size", size)
    spanNode.text = "\u2717"

    return spanNode

def check_mark(size=None):
    spanNode = ET.Element("span")
    add_style(spanNode, "color", COLOR_GREEN)
    if size is not None:
        add_style(spanNode, "font-size", size)
    spanNode.text = "\u2714"

    return spanNode

def add_basic_calendar(sectionNode, icon, calendar):
    pNode = ET.SubElement(sectionNode, "p")
    pNode.text = "Progress towards "
    bNode = ET.SubElement(pNode, "b")
    bNode.text = "366"
    bNode.tail = " addon ("
    bNode = ET.SubElement(pNode, "b")
    bNode.text = str(len(calendar))
    bNode.tail = " out of "
    bNode = ET.SubElement(pNode, "b")
    bNode.text = "366"
    bNode.tail = "):"

    tableNode = ET.SubElement(sectionNode, "table")
    trNode = ET.SubElement(tableNode, "tr")
    thNode = ET.SubElement(trNode, "th")
    thNode.append(icon_image(icon))

    for dayNum in range(1, 31 + 1):
        ET.SubElement(trNode, "th").text = str(dayNum)

    for monthName, monthNum, numDays in months:
        trNode = ET.SubElement(tableNode, "tr")

        ET.SubElement(trNode, "th").text = monthName[:3]

        for dayNum in range(1, numDays + 1):
            tdNode = ET.SubElement(trNode, "td")

            if (monthNum, dayNum) in calendar:
                tdNode.append(check_mark())

        for extraDay in range(numDays + 1, 31 + 1):
            ET.SubElement(trNode, "td", {"bgcolor": "grey"})

def single_find_addon(qualifies, addonName):
    pNode = ET.Element("p")
    if qualifies:
        symbolNode = check_mark("2em")
    else:
        symbolNode = x_mark("2em")

    pNode.append(symbolNode)
    symbolNode.tail = " You "

    if not qualifies:
        symbolNode.tail += "do not "

    symbolNode.tail += "have a find that qualifies for the "

    bNode = ET.SubElement(pNode, "b")
    bNode.text = addonName
    bNode.tail = " addon."

    return pNode

def multi_find_addon(have, needed, addonName):
    pNode = ET.Element("p")
    if have >= needed:
        symbolNode = check_mark("2em")
    else:
        symbolNode = x_mark("2em")

    pNode.append(symbolNode)
    symbolNode.tail = " You have "

    bNode = ET.SubElement(pNode, "b")
    bNode.text = str(have)
    bNode.tail = " out of the required "

    bNode = ET.SubElement(pNode, "b")
    bNode.text = str(needed)
    bNode.tail = " finds for the "

    bNode = ET.SubElement(pNode, "b")
    bNode.text = addonName
    bNode.tail = " addon."
    
    return pNode

def add_dt_info(sectionNode, icon, dtGrid, leapday=False):
    # DT Grid
    pNode = ET.SubElement(sectionNode, "p")
    pNode.text = "Progress towards "
    bNode = ET.SubElement(pNode, "b")
    bNode.text = ("Leapday" if leapday else "D/T")
    bNode.tail = " addon ("
    bNode = ET.SubElement(pNode, "b")
    bNode.text = str(len(dtGrid))
    bNode.tail = " out of "
    bNode = ET.SubElement(pNode, "b")
    bNode.text = "81"
    bNode.tail = "):"
    
    tableNode = ET.SubElement(sectionNode, "table")
    trNode = ET.SubElement(tableNode, "tr")
    thNode = ET.SubElement(trNode, "th")
    thNode.append(icon_image(icon))

    for t in dt:
        ET.SubElement(trNode, "th").text = t

    for d in dt:
        trNode = ET.SubElement(tableNode, "tr")

        ET.SubElement(trNode, "th").text = d

        for t in dt:
            tdNode = ET.SubElement(trNode, "td")

            if (d,t) in dtGrid:
                tdNode.append(check_mark())
    
    # Way to 81
    caches = sorted([(*v, k) for k,v in dtGrid.items()])

    
    detailsNode = ET.SubElement(sectionNode, "details")
    summaryNode = ET.SubElement(detailsNode, "summary")
    summaryNode.text = "Way to 81"

    tableNode = ET.SubElement(detailsNode, "table")
    theadNode = ET.SubElement(tableNode, "thead")
    trNode = ET.SubElement(theadNode, "tr")
    ET.SubElement(trNode, "th").text = "#"
    ET.SubElement(trNode, "th").text = "Date"
    ET.SubElement(trNode, "th").text = "Interval"
    ET.SubElement(trNode, "th").text = "GCCode"
    ET.SubElement(trNode, "th").text = "Cache Name"
    ET.SubElement(trNode, "th").text = "Type"
    ET.SubElement(trNode, "th").text = "D/T"

    tbodyNode = ET.SubElement(tableNode, "tbody")

    for ix, ((foundDate, lid), code, name, cacheType, (d, t)) in enumerate(caches, 1):
        trNode = ET.SubElement(tbodyNode, "tr")

        ET.SubElement(trNode, "td").text = str(ix)

        tdNode = ET.SubElement(trNode, "td")
        aNode = ET.SubElement(tdNode, "a", {"href": "https://www.geocaching.com/seek/log.aspx?LID=" + lid})
        aNode.text = foundDate.isoformat()

        tdNode = ET.SubElement(trNode, "td")
        if ix != 1:
            interval = (foundDate - prevDate).days
            tdNode.text = str(interval) + " day" + ("s" if interval != 1 else "")
        prevDate = foundDate

        tdNode = ET.SubElement(trNode, "td")
        aNode = ET.SubElement(tdNode, "a", {"href": "https://coord.info/" + code})
        aNode.text = code

        tdNode = ET.SubElement(trNode, "td")
        add_style(tdNode, "text-align", "left")
        tdNode.text = name

        tdNode = ET.SubElement(trNode, "td")
        tdNode.append(icon_image(typeIcons[cacheType], "16px"))

        tdNode = ET.SubElement(trNode, "td")
        if d[0] in {"3", "4", "5"}:
            bNode = ET.SubElement(tdNode, "b")
            bNode.text = d
            bNode.tail = "/"
            if t[0] in {"3", "4", "5"}:
                ET.SubElement(tdNode, "b").text = t
            else:
                bNode.tail += t
        else:
            tdNode.text = d + "/"
            if t[0] in {"3", "4", "5"}:
                ET.SubElement(tdNode, "b").text = t
            else:
                 tdNode.text += t


def traveling_grid(sectionNode, grid):
    pNode = ET.SubElement(sectionNode, "p")
    pNode.text = "Cells with a "
    checkNode = check_mark()
    pNode.append(checkNode)
    checkNode.tail = " means you have two countries. Cells with flags "
    checkNode.tail += "show the one country you already have."
    
    pNode = ET.SubElement(sectionNode, "p")
    pNode.text = "Progress towards "
    bNode = ET.SubElement(pNode, "b")
    bNode.text = "D/T"
    bNode.tail = " addon ("
    bNode = ET.SubElement(pNode, "b")
    bNode.text = str(len({k for k,v in grid.items() if v == True}))
    bNode.tail = " out of "
    bNode = ET.SubElement(pNode, "b")
    bNode.text = "81"
    bNode.tail = "):"
    
    tableNode = ET.SubElement(sectionNode, "table")
    trNode = ET.SubElement(tableNode, "tr")
    thNode = ET.SubElement(trNode, "th")
    thNode.append(icon_image(iconTraveling))

    for t in dt:
        ET.SubElement(trNode, "th").text = t

    for d in dt:
        trNode = ET.SubElement(tableNode, "tr")

        ET.SubElement(trNode, "th").text = d

        for t in dt:
            tdNode = ET.SubElement(trNode, "td")

            if grid[(d,t)] == True:
                tdNode.append(check_mark())
            elif grid[(d,t)] != False:
                country = grid[(d,t)]
                tdNode.append(icon_image((country, FLAGS.flagsUnicode[country])))

def add_leapday_attributes(sectionNode, haveAttributes):
    needAttributes = attributes.knownAttributes.difference(haveAttributes)

    needAttributes.difference_update({attributes.CACTUS, attributes.LOST_AND_FOUND,
                                      attributes.NEEDS_MAINTENANCE, attributes.PARTNERSHIP})

    haveAttributes.difference_update({attributes.CACTUS, attributes.LOST_AND_FOUND,
                                      attributes.NEEDS_MAINTENANCE, attributes.PARTNERSHIP})

    pNode = ET.SubElement(sectionNode, "p")
    pNode.text = "For the "
    bNode = ET.SubElement(pNode, "b")
    bNode.text = "Leapday"
    bNode.tail = " addon..."

    ulNode = ET.SubElement(sectionNode, "ul")
    liNode = ET.SubElement(ulNode, "li")
    liNode.text = "You have:"
    ET.SubElement(liNode, "br")
    _attribute_gallery(liNode, haveAttributes)

    liNode = ET.SubElement(ulNode, "li")
    liNode.text = "You need:"
    ET.SubElement(liNode, "br")
    _attribute_gallery(liNode, needAttributes)

def _attribute_gallery(node, attributeSet):
    divNode = ET.SubElement(node, "div")
    add_style(divNode, "display", "flex")
    add_style(divNode, "width", "60%")
    add_style(divNode, "flex-wrap", "wrap")
    add_style(divNode, "align-content", "flex-start")

    for ix in range(1, 73):
        for a in [ix, -ix]:
            if a in attributeSet:
                imgNode = icon_image(attributes.attributeIcons[a])
                add_style(imgNode, "margin", "5px")

                divNode.append(imgNode)

