def traveling_single(sectionNode, status, addonName):
    pNode = ET.SubElement(sectionNode, "p")

    if status == True:
        symbolNode = check_mark("2em")
    else:
        symbolNode = x_mark("2em")

    pNode.append(symbolNode)

    if status == False:
        symbolNode.tail = " You do not have any qualifying finds for the "
    elif status == True:
        symbolNode.tail = " You have qualifying finds for the "
    else:
        symbolNode.tail = " You only have find(s) in "
        icon_node = icon_image((status, FLAGS.flagsUnicode[status]))
        pNode.append(icon_node)
        icon_node.tail = " for the "

    bNode = ET.SubElement(pNode, "b")
    bNode.text = addonName
    bNode.tail = " addon."


