def icon_image(icon, size="32px"):
    iconDescription, iconData = icon
    if iconData.startswith("data:img/"):
        iconNode = ET.Element("img", {"title": iconDescription,
                                     "alt": iconDescription,
                                     "height": size, "width": size,
                                     "src": iconData})
    else:
        iconNode = ET.Element("span", {"title": iconDescription})
        iconNode.text = iconData

    return iconNode

